  true,\n\t\"url\": null,\n\t\"notes\": \"U.S. Population Grids (Summary File 1),
  2000: Metropolitan Statistical Areas contain grids of nndemographic and socioeconomic
  data from the year 2000 U.S. census in ASCII and geotiff formats for 50 metropolitan
  statistical areas nnwith at least one million in population. The grids have a resolution
  of 7.5 arc-seconds (0.002075 decimal degrees), or approximately nn250 square meters.
  The gridded variables are based on census block geography from Census 2000 TIGER/Line
  Files and census variables nn(population, households, and housing variables). This
  dataset is produced by the Columbia University Center for International Earth nnScience
  Information Network (CIESIN).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
